// >>> flip_case(("Hello"))
// ("hELLO")
std::string flip_case(std::string string) {
    std::string result;
    for (int i = 0; i < string.length(); i++) {
        if (string[i] >= 'a' && string[i] <= 'z') {
            result += string[i] - 32;
        } else if (string[i] >= 'A' && string[i] <= 'Z') {
            result += string[i] + 32;
        } else {
            result += string[i];
        }
    }
    return result;

