    for (long i = 1; i <= n; i++)
        count_start_one += (long)pow(10, i - 1) + 1;

    // Count of numbers ending with 1
    long count_end_one = 0;
    for (long i = 1; i <= n; i++)
        count_end_one += (long)pow(10, n - i) + 1;

    // Count of numbers that start and end with 1
    long count_start_and_end_one = 0;
    for (long i = 1; i <= n; i++)
        count_start_and_end_one += (long)pow(10, i - 1) + 1 + (long)pow(10, n - i) + 1;

