            if(a[i] == b[i]) continue;
            if(a.find(b, i) != std::string::npos) return true;
        }
    }
    for(int i = 0; i < a.length(); i++) {
        if(a[i] == b[0]) {
            std::string temp = a.substr(i+1, a.length()-i-1);
